sources.styles/blocks/page.scss:
.page {
  &__body {
    margin: 0;
    background-color: #1d1d1d;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(-100%);
    transition: transform 0.3s ;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 92px;
  }

  &__section--title {
    font-weight: 500;
    font-size: 32px;
    line-height: 32px;
    margin-bottom: 48px;

    text-align: center;
    letter-spacing: -1.5px;
    color: #fff;

    @include onTablet {
      font-size: 48px;
    }

    @include onDesktop {
      font-weight: 500;
      font-size: 64px;
      line-height: 100%;
    }
  }
}

