sources.styles/blocks/header.scss:
.header {
  width: 100%;

  background-size: cover;
  background-position: right;
  background-image: url("../images/Cover_photo.png");
  background-repeat: no-repeat;

  &__call {
    position: relative;
    width: 18px;
    height: 18px;
    text-decoration: none;

    @include onDesktop {
      width: 24px;
      height: 24px;
    }

    &::before {
      content: "+1 234 5555-55-55";
      position: absolute;
      top: 50%;
      transform: translate(-100%, -50%);
      display: block;
      padding-right: 20px;
      width: max-content;
      font-family: inherit;
      font-weight: 700;
      font-size: 12px;
      line-height: 16px;
      letter-spacing: 2px;
      text-transform: uppercase;
      color: #fff;
      opacity: 0;
      pointer-events: none;
    }

    &:hover::before {
      opacity: 1;
      pointer-events: all;
    }

  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    height: 100vh;
    padding: $headerTopPadding 0;

    @include onTablet {
      padding: 36px 0 88px;
    }
  }

  &__wrapper {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    gap: 30px;
  }

  &__title {
    font-family: inherit;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    text-align: center;
    margin-bottom: 100px;
    font-weight: 700;
    font-size: 36px;
    line-height: 100%;
    color: #fff;
    letter-spacing: -1.5px;

    @include onTablet {
      font-size: 64px;
    }

    @include onDesktop {
      font-size: 80px;
      line-height: 80px;
      letter-spacing: -1.5px;
    }
  }
}

