sources.styles/blocks/menu.scss:
.menu {
  overflow-y: auto;
  background-color: #e5e5e5;
  height: 100vh;
  padding: $headerTopPadding 0;

  &__content {
    @include onTablet {
      padding: 36px 0 88px;
    }
  }

  &__top {
    margin-bottom: 40px;
  }

  &__list {
    margin: 0 0 40px;
    padding: 0;
    list-style: none;
  }

  &__item {
    margin-bottom: 32px;

    &:last-child {
      margin-bottom: 0;
    }
  }

  &__link {
    display: inline-block;
    padding-bottom: 8px;
    border-bottom: 1px solid transparent;

    color: #1d1d1d;
    text-decoration: none;
    font-weight: 600;
    font-size: 22px;
    line-height: 22px;
    letter-spacing: 2px;
    text-transform: uppercase;

    transition: border-color 0.3s;

    &:hover {
      border-color: #1d1d1d;
    }
  }

  &__call {
    display: block;
    width: max-content;
    font-weight: 600;
    font-size: 16px;
    line-height: 27px;
    text-transform: uppercase;
    color: #1d1d1d;
    text-decoration: none;

    &--phone {
      margin-bottom: 16px;
      transition: border-color 0.3s;

      &:hover {
        border-bottom: 1px solid #1d1d1d;
      }
    }

    &--action {
      padding-bottom: 8px;
      transition: border-color 0.3s;

      &:hover {
        border-bottom: 1px solid #1d1d1d;
      }
    }
  }
}

sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
    column-gap: 24px;
  }

  &--tablet {
    display: block;

    @include onTablet {
      display: grid;
    }
  }

  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
    column-gap: 20px;
  }

  &--desktop {
    display: block;

    @include onDesktop {
      display: grid;
    }
  }

  &__item {
    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start} / #{$end + 1};
          }
        }

        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

