sources.styles/blocks/details.scss:
.details {
  margin: 20px 20px;

  &__photos {
    margin-bottom: 16px;
  }

  @include onDesktop {
    margin-left: 120px;
    margin-right: 120px;
  }

  @include onDesign {
    margin-left: auto;
    margin-right: auto;
    max-width: 1020px;
  }

  &__title {
    font-weight: 400;
    font-size: 24px;
    line-height: 140%;
    color: #fff;
  }

  &__description {
    font-weight: 400;
    font-size: 16px;
    line-height: 140%;
    color: #fff;
    margin-bottom: 48px;
  }

  &__photo-container {
    box-sizing: border-box;
    position: relative;
    max-height: 321px;
    width: 100%;
    overflow: hidden;

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include onDesktop {
      height: 321px;
      margin-bottom: 0;
    }

    @include onTablet {
      height: 321px;
      margin-bottom: 0;
    }
  }

  &__photo {
    position: absolute;
    height: 100%;
    width: 100%;

    object-fit: cover;
    object-position: center;
    transition: transform 0.3s ease-in-out;

    &:hover {
      transform: scale(1.2);
    }
  }
}

