.button {
  margin: auto;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 56px;

  font-weight: 700;
  font-size: 16px;
  line-height: 27px;
  text-align: center;
  color: #1d1d1d;

  border: 1px solid #fff;
  border-radius: 40px;
  cursor: pointer;
  transition: all 0.3s;

  &__link {
    text-decoration: none;
    color: #1d1d1d;
  }

  &--last {
    margin-bottom: 48px;
    width: 100%;

  @include onDesktop {
